import React from 'react';
import { useTranslation } from 'react-i18next';

import { ICrypto } from '../../../models/crypto';

import classes from './Prices.module.scss';

interface Props {
  readonly prices: ICrypto | null;
  readonly pricesChangeHandler: (value: ICrypto | null) => void;
}

const LoginOTPCodeView: React.FC<Props> = (props: React.PropsWithChildren<Props>) => {
  const { t } = useTranslation();

  return (
    <div className={classes['prices']}>
      <div className={classes['container']}>
        <h1 className={classes['container__header']}>{t('prices.header')}</h1>
        <div className={classes['innerContainer']}>
          {/* <Bitcoin /> */}
          <a className={classes['innerContainer__text']} href="/">Bitcoin</a>
          <span className={classes['innerContainer__text']}>- BTCUSD: 1324123234</span>
        </div>
        <div className={classes['innerContainer']}>
          {/* <Ethereum /> */}
          <a className={classes['innerContainer__text']} href="/">Ethereum</a>
          <span className={classes['innerContainer__text']}>- ETHUSD: 4923.4924</span>
        </div>
        <div className={classes['innerContainer']}>
          {/* <Litecoin /> */}
          <a className={classes['innerContainer__text']} href="/">Litecoin</a>
          <span className={classes['innerContainer__text']}>- LTCUSD: 239.4232</span>
        </div>
      </div>
    </div>
  );
};

LoginOTPCodeView.displayName = 'LoginOTPCodeView';
LoginOTPCodeView.defaultProps = {};

export default LoginOTPCodeView;
